svg.script:
      function mapPulser() {
				var mapDots = document.getElementsByClassName('map-dot');
				var numberOfDotsToShow = 6;
				var randomNumbers = [];
				// hide dots
				setInterval(function() {
					// Hide dots that were showing before
					if (randomNumbers.length) {
						for (var n = 0; n < numberOfDotsToShow; n++) {
							mapDots[randomNumbers[n]].style.display = 'none';
						}
						randomNumbers.length = 0;
					}
					// populate array
					for (var i = 0; i < numberOfDotsToShow; i++) {
						randomNumbers.push(Math.floor(Math.random() * mapDots.length));
					}
					// Show new dots
					for (var j = 0; j < numberOfDotsToShow; j++) {
						mapDots[randomNumbers[j]].style.display = 'block';
						mapDots[randomNumbers[j]].classList.add('pulser');
					}
				}, 5000);
  		}
			mapPulser();
